/** @jsxImportSource @emotion/react */
import { css, jsx } from '@emotion/react'
import styled from '@emotion/styled'
import Nav from "../components/Nav";

const Button = styled.button`
  padding: 32px;
  background-color: hotpink;
  font-size: 24px;
  border-radius: 4px;
  color: black;
  font-weight: bold;
  &:hover {
    color: white;
  }
`

function Home() {
    return(
      <div>
        <Nav></Nav>
        <Button>Home</Button>
      </div>
    )
}

export default Home;
